script: |
  super -f text -I q9595.spq | sort > q9595.out

inputs:
  - name: q9595.spq
    data: |
      SELECT - + col0 FROM tab1 (FORMAT parquet) WHERE ( NOT 19 + + col1 / - col1 + 40 * + 85 + - col1 IS NULL );
  - name: tab1

outputs:
  - name: q9595.out
    data: |
      -51
      -85
      -91
